import React from "react";
import DeleteIcon from "@mui/icons-material/Delete";
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';



function Note(props) {
  return (
    <Card className="note">
      <h1>{props.title}</h1>
      <hr/>
      <br/>
      <p>{props.content}</p>

      <button
        onClick={() => {
          return props.onDelete(props.id);
        }}
      >
       <DeleteIcon/>
      </button>
    </Card>
  );
}

export default Note;

